import React from "react"

class NavigationButton extends React.Component {
  constructor(props) {
    super(props)

  }
  page = `${this.props.page * 50 + 1} - ${this.props.page + 49 * 50}`
  render() {
    return (
      <button className="navigation-button">
        {this.page}
      </button>
    )
  }
}

export default NavigationButton
